import React from 'react';
import './homepage.css';

const HomePage = () => {
  return (
    <div class='home-container'>
      <h1 class='h1'>Inventory Management!</h1>
      {/* Add content specific to inventory management */}
      <div className="white-line"></div>
    </div>
  );
};

export default HomePage;
